function getPoints(value, index) {
    var point = 5;
    var total = 360 / 5;
    var x = 0;
    var centerX = 250;
    var centerY = 250;
    var centerR = value * 2;
    var degree = (index * total) - 90; //角度（上を頂点として描画するために90度引く）
    var radian = degree * (Math.PI / 180); //ラジアン変換
    var cos = Math.cos(radian) * centerR + centerX; //x
    var sin = Math.sin(radian) * centerR + centerY; //y
    return {
        x: cos,
        y: sin
    };
}
function dirstDrawPolygon() {
    var degree = 72; //角度
    var centerX = 250;
    var centerY = 250;
    var centerR = 200;
    var points = [];
    for (var i = 0; i < 5; i++) {
        var temparr = [];
        var degree = (i * 72) - 90; //角度（上を頂点として描画するために90度引く）
        var radian = degree * (Math.PI / 180); //ラジアン変換
        var cos = Math.cos(radian) * centerR + centerX; //x
        var sin = Math.sin(radian) * centerR + centerY; //y
        points[i] = { x: cos, y: sin };
    }
    var html = '';
    for (var key in points) {
        html += points[key]['x'] + ',' + points[key]['y'] + ' ';
    }
    $('.base').html('<polygon points="' + html + '">');
}
$(function () {
    dirstDrawPolygon();
    new Vue({
        el: '#vue-skill',
        data: {
            stats: stats
        }
    });
});

